sources.css\\main.scss:
    $bleu: #09021e;
    $cyan: #4cc9f0;
    $magenta: #f72585;

    * {
        box-sizing: border-box;
        cursor: none !important;
        user-select: none;
    }

    body {
        margin: 0;
        padding: 0;
        width: 100%;
        background: $bleu;
        overflow: hidden !important;
        height: 100vh;
    }

    .progress {
        position: fixed;
        transform: translate(-50%, -50%);
        left: 50%;
        top: 50%;
        font-family: 'littleTitle'!important;
        color: $cyan;
        font-size: 12px;
        letter-spacing: 1px;
        transition: 1.5s ease-in-out;

        @media screen and (max-width: 539px) {
            font-size: 2.6vw;
            letter-spacing: .2vw;
        }

        &.switch {
            opacity: 0;
        }
    }

    .containerAlertDiscord {
        position: absolute;
        right: 18px;
        width: 300px;
        height: fit-content;
        background: $bleu;
        top: 70px;
        z-index: 10;
        border: 1px solid $cyan;
        clip-path: inset(0% 0% 0% 100%);

        h3 {
            font-family: "littleTitle";
            font-size: 15px;
            letter-spacing: 1px;
            color: $cyan;
            margin: 10px 3px 10px 3px;
            text-align: center;
            font-weight: normal;
            opacity: 0;
        }
    }

    .containerAlertIut {
        position: absolute;
        left: 18px;
        width: 300px;
        height: fit-content;
        background: $bleu;
        top: 70px;
        z-index: 10;
        border: 1px solid $cyan;
        clip-path: inset(0% 100% 0% 0%);

        h3 {
            font-family: "littleTitle";
            font-size: 15px;
            letter-spacing: 1px;
            color: $cyan;
            margin: 10px;
            text-align: center;
            font-weight: normal;
            opacity: 0;
        }
    }

    .indicGoDesktop {
        display: none;


        @media screen and (max-width: 1024px) {
            position: absolute;
            top: 90%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-family: 'littleTitle';
            color: $cyan;
            z-index: 3;
            display: block;
            text-align: center;
            width: 80%;
            font-size: 12px;
            letter-spacing: 1px;
            opacity: 0;
            transition: .75s cubic-bezier(.25, 0, 0, 1);

            @media screen and (max-width: 539px) {
                font-size: 2.8vw;
                letter-spacing: .2vw;
            }

            &.switch {
                opacity: 1;
            }

        }
    }

    .homeMask {
        position: absolute;
        left: 0;
        top: 0;
        background: rgba(9, 2, 30, 0.4);
        z-index: 2;
        width: 100%;
        height: 100vh;
        opacity: 0;
    }

    canvas {
        display: block;
        position: absolute;
        height: 100vh;
        width: 100%;
        z-index: 1;
        opacity: 1;
        top: 0;
        left: 0;

        &.hologramActive {
            transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
            animation: blinkCanvas 6s infinite;
        }

        &.hologramDefault {
            transition: mix-blend-mode 2s cubic-bezier(.25, 0, 0, 1);
            animation: none;
        }

        @keyframes blinkCanvas {
            30% {
                opacity: 1;
            }

            32% {
                opacity: .7;
            }

            33% {
                opacity: 1;
            }

