    ////CURSOR CUSTOM///
    @media screen and (max-width: 1024px) {
        .cursor {
            display: none;
        }

        .cursor-shape_out {
            display: none;
        }

        .cursor-shape_out.mouseover {
            display: none;
        }
    }

    .cursor {
        position: fixed;
        pointer-events: none;
        z-index: 100;
        mix-blend-mode: difference;
        opacity: 0;
        transition: opacity .75s cubic-bezier(.25, 0, 0, 1);
    }

    .cursorSize {
        position: absolute;
        pointer-events: none;
        width: 20px;
        height: 20px;
        padding: 0;
        left: 0;
        top: 0;
        border-radius: 50px;
    }

    .cursor-shape_in {
        position: absolute;
        pointer-events: none;
        border-radius: 50px;
        left: 0;
        top: 0;
        width: 20px;
        height: 20px;
        background: $cyan;
        transition: opacity .75s cubic-bezier(.25, 0, 0, 1);

        &.mouseover {
            transition: opacity .5s cubic-bezier(.25, 0, 0, 1);
            opacity: 0;
        }
    }

    .cursor-shape_out {
        opacity: 0;
        mix-blend-mode: difference;
        z-index: 99;
        position: absolute;
        pointer-events: none;
        border-radius: 50px;
        left: 0;
        top: 0;
        width: 50px;
        height: 50px;
        border: $cyan solid 1px;
        transition: padding .75s cubic-bezier(.25, 0, 0, 1);
    }

    .indicMouseHover {
        opacity: 0;
        z-index: 100;
        position: absolute;
        top: 50%;
        left: 50%;
        color: $cyan;
        pointer-events: none;
        font-family: littleTitle;
        font-size: 10px;
        font-weight: bold;
        letter-spacing: 1.5px;
        transition: opacity .1s cubic-bezier(.75, 0, 0, 1);

        &.planeHover {
            transition: opacity .75s cubic-bezier(.75, 0, 0, 1);
            opacity: 1;
        }

        @media screen and (max-width: 1024px) {
            display: none;
        }
    }


    .indicClickOnPlane {
        transform: translate(-37%, 20%);
    }

