    .title,
    .littleTitle {
        width: 50vw;
        animation: blinkTitle 8s infinite ease-in-out alternate;
        opacity: 0;

        @media screen and (max-width: 539px) {
            width: 90vw;
        }



        path,
        line {
            fill: none;
            stroke: #4CC9F0;
            stroke-width: 0.5;
            stroke-miterlimit: 10;
            stroke-dashoffset: -1000;
            stroke-dasharray: 1000;
        }
    }

    .pathTitleIn {
        animation: titleIn 7.5s forwards ease-in-out;
    }

    .pathLineIn {
        animation: lineIn 6s forwards ease-in-out;
    }

    .pathTitleOut {
        animation: titleOut 7.5s forwards ease-in-out;
    }

    .pathLineOut {
        animation: lineOut 6s forwards ease-in-out;
    }

    @keyframes titleIn {
        0% {
            stroke-dashoffset: -1000;
        }

        40% {
            stroke-dashoffset: 0;
            fill: transparent;
        }

        45% {
            fill: $cyan;
        }

        70% {
            fill: $cyan;
        }

        100% {
            fill: $cyan;
            stroke-dashoffset: 0;
        }
    }

    @keyframes titleOut {
        0% {
            stroke-dashoffset: 0;
            fill: $cyan;
        }

        10% {
            fill: transparent;
        }

        80% {
            stroke-dashoffset: -1000;
            fill: transparent;
        }

        85% {
            fill: transparent;
        }

        100% {
            fill: transparent;
            stroke-dashoffset: -1000;
        }
    }

    @keyframes lineIn {
        0% {
            stroke-dashoffset: -1000;
            stroke-width: 0.5px;
        }

        40% {
            stroke-dashoffset: 0;
            fill: transparent;
            stroke-width: 0.5px;
        }

        45% {
            fill: transparent;
            stroke-width: 0.5px;
        }

        70% {
            stroke-width: 4px;
            stroke-dashoffset: 0;
        }

        100% {
            stroke-width: 4px;
            stroke-dashoffset: 0;
        }
    }

    @keyframes lineOut {
        0% {
            stroke-dashoffset: 0;
            stroke-width: 4px;
        }

        10% {
            stroke-width: 0.5px;
        }

        80% {
            stroke-dashoffset: -1000;
            stroke-width: 0.5px;
        }

        85% {
            stroke-width: 0.5px;
        }

        100% {
            stroke-width: 0.5px;
            stroke-dashoffset: -1000;
        }
    }

    @keyframes blinkTitle {
        0% {
            filter: drop-shadow(0 0 2px $cyan);
        }

        20% {
            filter: drop-shadow(0 0 4px $cyan);
        }

        40% {
            filter: drop-shadow(0 0 2px $cyan);
        }

        60% {
            filter: drop-shadow(0 0 4px $cyan);
        }

        80% {
            filter: drop-shadow(0 0 2px $cyan);
        }

        100% {
            filter: drop-shadow(0 0 4px $cyan);
        }
    }

