        @keyframes inSM {
            to {
                transform: translateX(0);
            }
        }

        @keyframes outSM {
            to {
                transform: translateX(175%);
            }
        }

        @keyframes outImpairSM {
            to {
                transform: translateX(-175%);
            }
        }

        &__1 {
            bottom: 2.4%;
            opacity: 0;
            pointer-events: none;

            @media screen and (max-width: 539px) {
                bottom: .5%;
            }

            &.mouseover::after {
                content: "FB";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseover::before {
                content: "FB";
                position: absolute;
                transform: translateX(-175%);
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
            }

            &.mouseout::after {
                content: "FB";
                position: absolute;
                animation: inSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(-175%);
            }

            &.mouseout::before {
                content: "FB";
                position: absolute;
                animation: outSM .5s cubic-bezier(.75, 0, 0, 1) forwards;
                transform: translateX(0);
            }
        }

        &__2 {
